async function getUnsignedTxn(creatorAddress, goal, durationInSeconds) {
    const response = await fetch('/api/createApp?creator=' + creatorAddress + "&goal=" + goal + "&duration=" + durationInSeconds);
    const responseBody = await response.json();
    if (response.ok) {
      return responseBody;
    }
    else
      throw responseBody;
  }

  export default getUnsignedTxn;
